import '../style/modal.css'

const Modal = ({modal, setModal}) => {
  return (
    <div className="modalContainer" onClick={() => setModal (prev => !prev)}>
      <div className="modalImage">
        {modal ? <img src="../images/produtos/ps5.jpg" alt="AHHH"/> : null} 
      </div>
    </div>
  )
}

export default Modal
